from collections import defaultdict
n = int(input())
points = []
for i in range(n):
    points.append(list(map(int, input().split())))
s = {(x, y) for x, y in points}
ans = 0
cnt = 0
for i in range(n):
    x, y = points[i]
    d = defaultdict(int)
    for j in range(n):
        if i == j:
            continue
        x1, y1 = points[j]
        dis = (x - x1) * (x - x1) + (y - y1) * (y - y1)
        d[dis] += 1

    for k, v in d.items():
        if v >= 2:
            ans += v * (v - 1) // 2  
for i in range(n):
    x, y = points[i]
    for j in range(i + 1, n):
        x1, y1 = points[j]
        if (2 * x - x1, 2 * y - y1) in s:
            cnt += 1
print(ans - cnt)

