N=3000+10
x=[0]*N
y=[0]*N
vis=[[0]*N for i in range(N)]
M=2000+10
f=[[0]*M for i in range(M)]
offset_val=1000
n=int(input())
for i in range(n):
    x[i],y[i]=map(int,input().split())
    f[x[i]+offset_val][y[i]+offset_val]=1
res=0
for i in range(n):
    m=dict()
    for j in range(n):
        if i==j:
            continue;
        dx=x[i]-x[j]
        dy=y[i]-y[j]
        dis=dx*dx+dy*dy
        if dis not in m.keys(): 
            m[dis]=0
        m[dis]+=1
    for k,v in m.items():
        res+=v*(v-1)//2

for i in range(n):
    for j in range(i):
        xk=2*x[i]-x[j]
        yk=2*y[i]-y[j]
        if f[xk+offset_val][yk+offset_val]>0:
            res-=1
print(res)
